contracts/tokenia.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DataTokenization {
    struct Dataset {
        string name;
        string description;
        uint256 price;
        address owner;
        bytes32 encryptedHash; // Hash criptografado dos dados de IA
        uint256 expiryTime; // Prazo de validade do acesso em segundos
    }

    mapping(uint256 => Dataset) public datasets;
    mapping(address => mapping(uint256 => bool)) public access;
    mapping(uint256 => address[]) public accessHistory; // Historico de transferencias e compras para cada token
    uint256 public datasetCount;

    event TokenPurchase(uint256 indexed datasetId, address indexed buyer, uint256 timestamp);
    event TokenTransfer(uint256 indexed datasetId, address indexed from, address indexed to, uint256 timestamp);

    // Adiciona um novo conjunto de dados ao sistema
    function registerDataset(
        string memory _name, 
        string memory _description, 
        uint256 _price, 
        bytes32 _encryptedHash,
        uint256 _expiryTime // Em segundos a partir da criacao
    ) public {
        datasetCount++;
        datasets[datasetCount] = Dataset(_name, _description, _price, msg.sender, _encryptedHash, block.timestamp + _expiryTime);
    }

    // Compra o acesso ao conjunto de dados
    function buyAccess(uint256 _datasetId) public payable {
        // Verifica se o dataset existe
        require(_datasetId > 0 && _datasetId <= datasetCount, "Dataset especificado nao existe");

        Dataset storage dataset = datasets[_datasetId];
        require(msg.value == dataset.price, "Valor incorreto para compra");

        // Concede acesso ao comprador e adiciona ao historico
        access[msg.sender][_datasetId] = true;
        accessHistory[_datasetId].push(msg.sender);

        // Transfere o pagamento ao proprietario original e registra o evento
        payable(dataset.owner).transfer(msg.value);
        emit TokenPurchase(_datasetId, msg.sender, block.timestamp);
    }

    // Verifica se o usuario possui acesso ao conjunto de dados e se o acesso ainda e valido
    function hasAccess(uint256 _datasetId) public view returns (bool) {
        if (access[msg.sender][_datasetId] && block.timestamp <= datasets[_datasetId].expiryTime) {
            return true;
        }
        return false;
    }

    // Transferencia de acesso entre usuarios com royalties
    function transferAccess(uint256 _datasetId, address _newOwner) public payable {
        require(access[msg.sender][_datasetId], "Voce nao possui acesso a este dataset");
        require(msg.value > 0, "Valor para transferencia deve ser positivo");

        // Calcula royalties para o dono original (10% do valor de transferencia)
        uint256 royalty = (msg.value * 10) / 100;
        payable(datasets[_datasetId].owner).transfer(royalty);

        // Transfere o restante para o vendedor atual
        payable(msg.sender).transfer(msg.value - royalty);

        // Atualiza acesso, remove do antigo e adiciona ao novo dono
        access[msg.sender][_datasetId] = false;
        access[_newOwner][_datasetId] = true;
        accessHistory[_datasetId].push(_newOwner);

        emit TokenTransfer(_datasetId, msg.sender, _newOwner, block.timestamp);
    }

    // Retorna o historico de acesso de um conjunto de dados
    function getAccessHistory(uint256 _datasetId) public view returns (address[] memory) {
        return accessHistory[_datasetId];
    }

    // Retorna o hash criptografado dos dados (somente para usuarios com acesso)
    function getEncryptedHash(uint256 _datasetId) public view returns (bytes32) {
        require(hasAccess(_datasetId), "Acesso negado. Voce nao possui permissao para ver esses dados.");
        return datasets[_datasetId].encryptedHash;
    }
}

